import React from 'react'

export class index extends React.Component {
	render() {
		return (
			<div className="cart">
				<div className="details">
					<div className="cardHeader">
					<h2>Continue to shop</h2>
					</div>
				</div>
			</div>
		)
	}
}

export default index
